<script type="text/javascript">
window.errors = [];
if (window.addEventListener) {
  window.addEventListener('error', function(e) {
    if (e.message) {
      if (e.error && e.error.stack) {
        if (e.message.indexOf('Uncaught SyntaxError') === 0) {
          window.errors.push(e.message + ' at ' + e.filename + ':' + e.lineno + ':' + e.colno);
        } else {
          window.errors.push(e.error.stack);
        }
        if (window.onNewError) window.onNewError();
      }
    } else {
      window.errors.push('Problem loading ' + (e.target.src || e.target.href));
      if (window.onNewError) window.onNewError();
    }
    window.onerror = null;
  }, true); // true so that errors bubble up to window
  window.addEventListener('unhandledrejection', function(e) {
    window.errors.push(e.reason && (e.reason.stack || e.reason.message || e.reason));
    if (window.onNewError) window.onNewError();
  }, false);
}
window.onerror = function(message, source, lineno, colno, error) {
  if (colno) {
    lineno += ':' + colno;
  }
  if (error && error.stack) {
    window.errors.push(error.stack);
  } else {
    window.errors.push(message + ' at ' + source + ':' + lineno);
  }
  if (window.onNewError) window.onNewError();
};
</script>

.monitor {
  position: absolute;
  border: 1px solid transparent;
  
  border-color: rgba(0, 0, 0, 0.2);
  background-color: rgba(0, 0, 0, 0.3);
  
  border-radius: 0.25rem;
  font-size: 0.75rem;
  overflow: hidden;
  padding: 3px;
  color: #ffffff;
  white-space: pre;
}
.monitor-label {
  margin: 0 5px;
  font-weight: bold;
}
.monitor-value {
  display: inline-block;
  vertical-align: top;
  min-width: 34px;
  text-align: center;
  border-radius: 0.25rem;
  overflow: hidden;
  text-overflow: ellipsis;
  user-select: text;
  transform: translateZ(0);
}
.default .monitor-value, .slider .monitor-value {
   background-color: rgba(0, 0, 0, 0.5); 
  margin: 0 5px;
  padding: 1px 3px;
}
.large {
   background-color: rgba(0, 0, 0, 0.6); 
  padding: 0.1rem 0.25rem;
  min-width: 3rem;
}
.large .monitor-label {
  display: none;
}
.large .monitor-value {
  font-size: 1rem;
  width: 100%;
}
.list {
  padding: 0;
  overflow: auto;
  overflow-x: hidden;
}
.list .monitor-label {
  text-align: center;
  padding: 3px;
  width: 100%;
  display: block;
  margin: 0;
  box-sizing: border-box;
  white-space: pre-wrap;
}
.list .monitor-value {
  display: block;
}
.row {
  margin: 2px 5px;
  transform: translateZ(0);
  text-align: left;
  border-radius: 0.25rem;
  border: 1px solid transparent;
  
  border-color: rgba(0, 0, 0, 0.2);
  background-color: rgba(0, 0, 0, 0.5);
  
  height: 20px;
  line-height: 20px;
  padding: 0 5px;
  overflow: hidden;
  text-overflow: ellipsis;
}

.slider input {
  display: block;
  width: 100%;
  transform: translateZ(0);
}
#asking-box {
  display: none;
  position: absolute;
  left: 0;
  bottom: 0;
  right: 0;
  background-color: rgba(33, 33, 33, 0.7);
}
.asking #asking-box {
  display: block;
}
#question {
  display: block;
  margin: 0 10px;
  margin-top: 10px;
  font-size: 12px;
  color: white;
}
#answer {
  border: none;
  background: none;
  width: 100%;
  font: inherit;
  font-size: 16px;
  color: white;
  padding: 10px;
  box-sizing: border-box;
}
#answer:focus {
  outline: none;
}
#errors {
  -webkit-appearance: none;
  border: none;
  background: rgba(255, 0, 0, 0.7);
  color: white;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 1000;
  display: none;
}
</style>
